import React from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from './Component/Home';
import Navbar from './Component/Navbar';
import './style.css'

function App() {
  return (
    <div className="App">
      <Navbar/>
        <Routes>
        <Route path="/" element={<Layout />}/>

        </Routes>

      {/* <Home/> */}
    </div>
  );
}

export default App;
